import './Expense.css'
import ExpenseItem from './ExpenseItem'
const Expense = (props) => {

for (let i = 0; i < props.length; i++) {
    let element = props[i];
    return element;

}
    return (
        <div>
            <ExpenseItem title={element.title} amount={element.amount} date={element.date} />
          
        </div>
    )


}

export default Expense
